import * as React from "react";
import { extendTheme, styled } from "@mui/material/styles";
import List from "@mui/material/List";
import ListItem from "@mui/material/ListItem";
import ListItemIcon from "@mui/material/ListItemIcon";
import ListItemText from "@mui/material/ListItemText";
import DashboardIcon from "@mui/icons-material/Dashboard";
import ShoppingCartIcon from "@mui/icons-material/ShoppingCart";
import BarChartIcon from "@mui/icons-material/BarChart";
import DescriptionIcon from "@mui/icons-material/Description";
import LockIcon from "@mui/icons-material/Lock";
import ApiTwoToneIcon from "@mui/icons-material/ApiTwoTone";
import ScienceTwoToneIcon from "@mui/icons-material/ScienceTwoTone";
import AccountBalanceTwoToneIcon from "@mui/icons-material/AccountBalanceTwoTone";
import MonitorHeartIcon from "@mui/icons-material/MonitorHeart";
import DeviceHubIcon from "@mui/icons-material/DeviceHub";
import { AppProvider } from "@toolpad/core/AppProvider";
import { DashboardLayout } from "@toolpad/core/DashboardLayout";
import { Box } from "@mui/material";

const NAVIGATION = [
  { kind: "header", title: "Clearing" },
  { segment: "RTC", title: "RTC", icon: <AccountBalanceTwoToneIcon /> },
  { kind: "divider" },
  { segment: "EDSDeP", title: "EDSDeP", icon: <ApiTwoToneIcon />, disabled: true },
  { kind: "divider" },
  { segment: "SOSA", title: "SOSA", icon: <ScienceTwoToneIcon /> },
  { kind: "divider" },
  { segment: "DDS", title: "DDS", icon: <DeviceHubIcon /> },
  { kind: "divider" },
  { segment: "LOPR", title: "LOPR", icon: <DashboardIcon /> },
  { kind: "divider" },
  { segment: "KW", title: "Kafka Watcher", icon: <MonitorHeartIcon /> },
  { kind: "divider" },
  { kind: "header", title: "Environments" },
  {
    segment: "NCZ",
    title: "NCZ",
    icon: <BarChartIcon />,
    children: [
      { segment: "k8s-dev-01-clrg", title: "k8s-dev-01-clrg", icon: <DescriptionIcon /> },
      { segment: "k8s-dev-01-shared", title: "k8s-dev-01-shared", icon: <DescriptionIcon />, disabled: true },
    ],
  },
  {
    segment: "DPZ",
    title: "DPZ",
    icon: <LockIcon />,
    children: [
      { segment: "k8s-dev-01-clearing", title: "k8s-dev-01-clearing", icon: <DescriptionIcon /> },
      { segment: "k8s-rat-01-shared", title: "k8s-rat-01-shared", icon: <DescriptionIcon /> },
    ],
  },
];

const DisabledNavItem = styled(ListItem)(({ theme }) => ({
  opacity: 0.5,
  pointerEvents: "none",
  cursor: "not-allowed",
}));

const StyledListItem = styled(ListItem)(({ theme }) => ({
  "&:hover": {
    backgroundColor: theme.palette.action.hover,
  },
}));

const renderNavigation = (navigation, navigate) => {
  return (
    <List>
      {navigation.map((item, index) => {
        if (item.kind === "divider") {
          return <hr key={index} />;
        }
        if (item.kind === "header") {
          return <h4 key={index}>{item.title}</h4>;
        }

        const ListItemComponent = item.disabled ? DisabledNavItem : StyledListItem;

        return (
          <ListItemComponent
            key={index}
            button
            onClick={() => !item.disabled && navigate(`/${item.segment}`)}
          >
            <ListItemIcon>{item.icon}</ListItemIcon>
            <ListItemText primary={item.title} />
            {item.children && renderNavigation(item.children, navigate)}
          </ListItemComponent>
        );
      })}
    </List>
  );
};

function useDemoRouter(initialPath) {
  const [pathname, setPathname] = React.useState(initialPath);
  return {
    pathname,
    searchParams: new URLSearchParams(),
    navigate: (path) => setPathname(String(path)),
  };
}

export default function DashboardLayoutBasic(props) {
  const router = useDemoRouter("/RTC");

  return (
    <AppProvider
      branding={{ title: "uDeploy" }}
      navigation={NAVIGATION}
      router={router}
    >
      <DashboardLayout>
        <Box sx={{ width: 250 }}>{renderNavigation(NAVIGATION, router.navigate)}</Box>
      </DashboardLayout>
    </AppProvider>
  );
}
